import React from 'react'

function Nav_Item(props) {
    
    return (
        <div onMouseEnter={()=>{backgroundColor:'teal'}} style={{display:'flex',alignItems:'center',}}>
            {props.icon}
            <p style={{margin:'0', color:'white', fontWeight:'w500', fontSize:'1rem'}}>{props.title}</p>
        </div>
    )
}

export default Nav_Item
